      'body' => array(
        'und' => array(
          array(
            'value' => "<p>Near Real time data are available a few hours after an observation is performed. The best way to access them is using the python API, see for instance this <a href=\"https://gitlab.astro.unige.ch/integral/qla/maxij1803\" target=\"_blank\">preliminary analysis</a>.</p>\r\n\r\n<p>Note, however, that a special permission should be asked and accept the term and conditions for the usage of private data (no access to Russian data can be granted).</p>\r\n\r\n<p>Should you want to use the web interface, it is necessary to use a custom science window list with the .000 suffix, for instance</p>\r\n\r\n<pre>\r\n236100030010.000,236100040010.000,236100050010.000,236100060010.000,236100090010.000,236100100010.000,236100110010.000,236100120010.000</pre>\r\n\r\n<p>and copy it inside the dedicated box</p>\r\n\r\n<p><a class=\"colorbox colorbox-insert-image\" data-colorbox-gallery=\"gallery-all\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda/custom-lc.png\"><img alt=\"\" class=\"same-gallery image-large\" height=\"462\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda/custom-lc.png?itok=7pFIPLqY\" width=\"480\" /> </a></p>\r\n\r\n<p>Alternatively, one can prepare a file with one scw per line and upload it after selecting \"Custom list in file\".</p>\r\n\r\n<p><a class=\"colorbox colorbox-insert-image\" data-colorbox-gallery=\"gallery-all\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda/customscwfile.png\"><img alt=\"\" class=\"same-gallery image-large\" height=\"480\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda/customscwfile.png?itok=xghN39p9\" width=\"366\" /> </a></p>\r\n\r\n<p>The file content is like:</p>\r\n\r\n<p>236100030010.000<br />\r\n236100040010.000<br />\r\n236100050010.000<br />\r\n236100060010.000<br />\r\n236100090010.000</p>\r\n",
            'summary' => '',
            'format' => 'full_html',
            'safe_value' => "<p>Near Real time data are available a few hours after an observation is performed. The best way to access them is using the python API, see for instance this <a href=\"https://gitlab.astro.unige.ch/integral/qla/maxij1803\" target=\"_blank\">preliminary analysis</a>.</p>\n\n<p>Note, however, that a special permission should be asked and accept the term and conditions for the usage of private data (no access to Russian data can be granted).</p>\n\n<p>Should you want to use the web interface, it is necessary to use a custom science window list with the .000 suffix, for instance</p>\n\n<pre>\n236100030010.000,236100040010.000,236100050010.000,236100060010.000,236100090010.000,236100100010.000,236100110010.000,236100120010.000</pre>\n\n<p>and copy it inside the dedicated box</p>\n\n<p><a class=\"colorbox colorbox-insert-image\" data-colorbox-gallery=\"gallery-all\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda/custom-lc.png\"><img alt=\"\" class=\"same-gallery image-large\" height=\"462\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda/custom-lc.png?itok=7pFIPLqY\" width=\"480\" /> </a></p>\n\n<p>Alternatively, one can prepare a file with one scw per line and upload it after selecting \"Custom list in file\".</p>\n\n<p><a class=\"colorbox colorbox-insert-image\" data-colorbox-gallery=\"gallery-all\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda/customscwfile.png\"><img alt=\"\" class=\"same-gallery image-large\" height=\"480\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda/customscwfile.png?itok=xghN39p9\" width=\"366\" /> </a></p>\n\n<p>The file content is like:</p>\n\n<p>236100030010.000<br />\n236100040010.000<br />\n236100050010.000<br />\n236100060010.000<br />\n236100090010.000</p>\n",
            'safe_summary' => '',
